import Col from 'react-bootstrap/Col';

function NewGrid()
{
    return(
        <>
        <Row>
            <Col>1 of 2</Col>
            <Col>2 of 2</Col>
        </Row>
        <Row>
            <Col>1 of 3</Col>
            <Col>2 of 3</Col>
            <Col>3 of 3</Col>
        </Row>
        </>
    )
}

export default NewGrid;
